import React from "react";

const HomePage = importByReactLazy("../Pages/Home/HomePage");
const AboutUsPage = importByReactLazy("../Pages/About_Us/AboutUsPage");
const ContactPage = importByReactLazy("../Pages/Contact/ContactPage");
const LoginPage = importByReactLazy("../Pages/Login/LoginPage");

export const mainPageLinks = [
    {endpoint: "/", page: HomePage,name:"HOME"},
    {endpoint: "/aboutus", page: AboutUsPage, name:"ABOUT US"},
    {endpoint: "/contact", page: ContactPage, name: "CONTACT"},
    {endpoint: "/login", page: LoginPage, name: "LOGIN"},
];

const DigitalPathologySolutionsPage = importByReactLazy("../Pages/Services/DigitalPathologySolutionsPage");
const DiagnosticCardiologySolutionsPage = importByReactLazy("../Pages/Services/DiagnosticCardiologySolutionsPage");
const DiagnosticRadiologySolutionsPage = importByReactLazy("../Pages/Services/DiagnosticRadiologySolutionsPage");

export const serviceDropDownMenuPageLinks = [
    {endpoint: "/digital-pathology-solutions", page: DigitalPathologySolutionsPage, name: "DIGITAL PATHOLOGY SOLUTIONS"},
    {endpoint: "/diagnostic-cardiology-solutions", page: DiagnosticCardiologySolutionsPage, name: "DIAGNOSTIC CARDIOLOGY SOLUTIONS"},
    {endpoint: "/diagnostic-radiology-solutions", page: DiagnosticRadiologySolutionsPage, name: "DIAGNOSTIC RADIOLOGY SOLUTIONS"}
];

export const allLinks = [mainPageLinks, serviceDropDownMenuPageLinks];

function importByReactLazy(filePath) {
    return React.lazy(() => import(filePath))
}
